import React, { Component } from 'react';
import './admin.css'

class AdminControl extends Component {
    render() {
        return (

            <div class='containerControl'>
                <label class='examList'>Exam List</label>
                <button id='createBtn'>Create Exam</button>
                
            </div>

        )
    }
}


export default AdminControl;
